import React from 'react';
var arrImage=[require('../img/job-photo.png'),require('../img/job-photo.png'),require('../img/job-photo.png')]
export default function Li(){
    return(
       <li>
           {arrImage.map(function(item){
               return   <>
                            <img src={item} alt=''/>
                            <span>客服</span>
                        </>
           })}
       </li>
    )
}
